import React from 'react';

export default class Form extends React.Component {
   render() {
      function ajout(a,b) {
         console.log(a, " ", b);
      }

      return (
        <div className="Form">
            <label>Nom</label>
            <input placeholder="Votre nom" id="nom" className="nom"></input>
            <label>Prénom</label>
            <input placeholder="Votre prenom" id="prenom" className="prénom"></input>
            <button className="btn btn-success" id="bouton" onClick="ajout(document.getElementById('nom'), document.getElementById('prenom'))">AJOUTER</button>
        </div>
      )
   }
}
